import React, { useState } from 'react';
import { createClient } from '@supabase/supabase-js';
import MovieCard from './MovieCard'; // Import the MovieCard component
import ExampleCard from './MovieCard'; // Ensure this path matches your file structure

const supabaseUrl = 'https://rqectbjbsthqwwhpydeq.supabase.co';
const supabaseKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InJxZWN0Ympic3RocXd3aHB5ZGVxIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MTQ0MTk5MjIsImV4cCI6MjAyOTk5NTkyMn0.lM3sBJ-m6x1mi1XHpiKNI_mi6WbdowxhbZjr5WBaSF0';
const supabase = createClient(supabaseUrl, supabaseKey);

function HomePage() {
  const [movieName, setMovieName] = useState('');
  const [movies, setMovies] = useState([]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { data, error } = await supabase
      .from('movies')
      .insert([{ name: movieName }]);

    if (error) {
      console.error('Error:', error);
      return;
    }

    setMovies([...movies, { name: movieName }]);
    setMovieName('');  // Reset the input after submitting
  };

  return (
    <div className="container mx-auto mt-10">
      <h1 className="text-2xl font-bold mb-6">Enter Movie Name</h1>
      <form onSubmit={handleSubmit} className="mb-6">
        <input
          type="text"
          className="border border-gray-300 p-2 mr-4 rounded"
          placeholder="Enter movie name"
          value={movieName}
          onChange={(e) => setMovieName(e.target.value)}
          required
        />
        <button type="submit" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
          Submit
        </button>
      </form>
      <div>
        <h2 className="text-xl font-semibold">Submitted Movies</h2>
        <ul>
          {movies.map((movie, index) => (
            <li key={index} className="list-disc list-inside">
              <ExampleCard movie={movie} />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default HomePage;
